Мужские плавательные шорты SOLIDS II на резинке, внутри шнурок. Спереди и сзади карманы. Внутри сетчатые плавки. Ткань Rib-stop позволяет шортам быстро сохнуть. Длина бокового шва 42 см.
Плавательные шорты - прекрасно подойдут для пляжного отдыха. Не обтягивают фигуру;
Ткань Rib-Stop (полиэстер 100%) - прочная и износостойкая, быстро сохнет, не дает усадку при стирке, не нуждается в глажении;
Сетчатые плавки внутри шорт - обеспечивают надежную посадку, вентиляцию и комфорт.
ткань верха (нейлон 100%), подкладка (полиэстер 100%)

