Характеристики:
- рекомендации по применению: снорклинг, пляжный отдых;
- количество стекол: моностекольная;
- вес, грамм: 125;
- возможность установки корректирующих линз (диоптрий): нет;
- покрытие стекла: нет;
- безрамочная технология: нет;
- крепление для GoPro: нет;
- материал иллюминатора: пластик;
