ОСОБЕННОСТИ:
Плавки-шорты - плавки, в виде обтягивающих шорт. Подходят для занятий в бассейне, а также для пляжного отдыха;
Ткань BASE - обеспечивает идеальную посадку, обладает высокой износостойкостью и улучшенными компрессионными характеристиками;
Высота бокового шва - 25 см;
Средняя посадка - обеспечивает комфорт, не сковывает движения.
Состав
ткань верха (полиэстер 85%, спандекс 15%), ткань подкладки (полиэстер 95%, спандекс 5%)

